import json
# Check for consistency across weeks
issues = []
for i in range(1, 12):
    with open(f'study-site/src/data/weeks/week{i}.json') as f:
        data = json.load(f)

        # Required top-level keys
        if 'week' not in data:
            issues.append(f'Week {i}: Missing week field')
        if 'dateRange' not in data:
            issues.append(f'Week {i}: Missing dateRange field')
        if 'topics' not in data or not data['topics']:
            issues.append(f'Week {i}: Missing or empty topics array')

        # Check each topic structure
        for idx, topic in enumerate(data.get('topics', [])):
            required = ['id', 'title', 'summary', 'keyTakeaways', 'content', 'questions']
            for field in required:
                if field not in topic:
                    issues.append(f'Week {i}, Topic {idx}: Missing {field}')

            # Check questions structure
            for qidx, q in enumerate(topic.get('questions', [])):
                if 'difficulty' not in q:
                    issues.append(f'Week {i}, Topic {idx}, Q{qidx}: Missing difficulty')
                if 'explanation' not in q:
                    issues.append(f'Week {i}, Topic {idx}, Q{qidx}: Missing explanation')
                elif isinstance(q['explanation'], dict):
                    if 'correct' not in q['explanation']:
                        issues.append(f'Week {i}, Topic {idx}, Q{qidx}: Missing correct explanation')
                    if 'incorrect' not in q['explanation']:
                        issues.append(f'Week {i}, Topic {idx}, Q{qidx}: Missing incorrect explanations')

if issues:
    for issue in issues:
        print(issue)
else:
    print('✓ All structural requirements met across all 11 weeks')
"

